<#
    .EXAMPLE

    PS>Import-Module .\PSUnzipper.ps1

    zip a folder with files with password
    PS> zip -sourcePath .\test -zipFilename xxx.zip -password infected

    unzip zip file with pasword
    PS> unzip -zipFile .\testaes.zip -unzipToFolder .\ -password 'infected'

    More zip files - one shot unzip
    Get-ChildItem -Path .\ -Filter "*.zip" | ForEach-Object {unzip -zipFile $_.FullName -unzipToFolder .\}
    #>



#SharpZipLiB .NET in base64 for loading in memory runtime
$ZIPlib_BASE64 = ""
$bytes = [System.Convert]::FromBase64String($ZIPlib_BASE64)
[System.Reflection.Assembly]::Load($bytes)
 
 function zip($sourcePath, $zipFilename, $password)
{
  $zip = New-Object ICSharpCode.SharpZipLib.Zip.FastZip
  $zip.Password = [string]$password
  $zip.CreateZip($zipFilename, $sourcePath, $true, "")
}

function unzip($zipFile, $unzipToFolder, $password)
{
  $zip = new-object icSharpCode.sharpZipLib.zip.fastZip
  $zip.Password = [string]$password
  $zip.extractZip($zipFile, $unzipToFolder, $null)
  

}
 
 
 
 
 
 